var Location = function(data) {
    var self = this;

    this.actor_1 = data.actor_1;
    this.actor_2 = data.actor_2;
    this.actor_3 = data.actor_3;
    this.director = data.director;
    this.distributor = data.distributor;
    this.fun_facts = data.fun_facts;
    this.locations = data.locations;
    this.place_id = data.place_id;
    this.production_company = data.production_company;
    this.release_year = data.release_year;
    this.title = data.title;
    this.writer = data.writer;

    this.lat = ko.observable(data.geometry.location.lat);
    this.lng = ko.observable(data.geometry.location.lng);
    this.address = ko.observable(data.formatted_address);

    var image = 'img/movie.png';

    var coords = new google.maps.LatLng(this.lat(), this.lng());
    var marker = new google.maps.Marker({
        position: coords,
        map: map,
        icon: image,
    });
    this.marker = ko.observable(marker);
    google.maps.event.addListener(marker, 'click', function(){
        viewModel.markerClicked(self);
    });

    var content = '<div id="content">' +
            '<div id="siteNotice">' + '</div>' +
            '<h1 id="heading" class="heading">' + data.title + '</h1>' +
            '</div>';

    // var content = data.name;

    this.contentString = ko.observable(content);

};

var ViewModel = function() {
    // store the outer 'this' which represents the ViewModel
    var self = this;

    this.locations = ko.observableArray([]);
    console.log(locations);

    // Create a new Title object for each item in the titles array.
    locations.forEach(function(loc){
        self.locations.push( new Location(loc) );
    });

    // set the current title
    this.currentLocation = ko.observable( this.locations()[0] );

    this.locationClicked = function(location) {
        console.log('ViewModel: location clicked!');

        console.log(this);

        // clear any marker that is currently bouncing.
        self.currentLocation().marker().setAnimation(null);

        // update the current title
        self.currentLocation(this);

        // make the selected location marker bounce
        location.marker().setAnimation(google.maps.Animation.BOUNCE);

        // center the map on the marker location
        var position = location.marker().position;
        console.log(position);

        location.marker().map.setCenter(location.marker().position);

        // map.setCenter(marker.getPosition());
    };

    // handles a click on a map marker
    this.markerClicked = function(title) {
        console.log(title);

        var marker = title.marker();
        console.log(marker);

        // toggle the info window
        infowindow = new google.maps.InfoWindow({
            content: title.contentString()
        });
        infowindow.open(map, marker);

        // toggle the bounce animation
        if (marker.getAnimation() !== null) {
            marker.setAnimation(null);
        } else {
            marker.setAnimation(google.maps.Animation.BOUNCE);
        }
    };
};


function get(url) {
  // Return a new promise.
  return new Promise(function(resolve, reject) {
    // Do the usual XHR stuff
    var req = new XMLHttpRequest();
    req.open('GET', url);

    req.onload = function() {
      // This is called even on 404 etc
      // so check the status
      if (req.status === 200) {
        // Resolve the promise with the response text
        resolve(req.response);
      }
      else {
        // Otherwise reject with the status text
        // which will hopefully be a meaningful error
        reject(Error(req.statusText));
      }
    };

    // Handle network errors
    req.onerror = function() {
      reject(Error("Network Error"));
    };

    // Make the request
    req.send();
  });
}
